          if ((link.id === 'profile' || link.id === 'overview') && onNavigate) {
            event.preventDefault();
            onNavigate(link.id);
          }
        };

        return (
          <a
            key={link.id}
            className="nav__link"
            href={link.url}
            aria-label={`${link.label}${showBadge ? ` (${badgeText} alerts)` : ''}`}
            onClick={(link.id === 'profile' || link.id === 'overview') && onNavigate ? handleClick : undefined}
